"use strict";

function f_gold(intervals) {
    intervals.sort((a, b) => a[0] - b[0]);
    let ans = [];
    let [st, ed] = intervals[0];
    for (let i = 1; i < intervals.length; i++) {
        let [s, e] = intervals[i];
        if (ed < s) {
            ans.push([st, ed]);
            [st, ed] = [s, e];
        } else {
            ed = Math.max(ed, e);
        }
    }
    ans.push([st, ed]);
    return ans;
}
